- input: 'TEXT,F3XA,,"This amendment is in response to the Commission''s Dec. 29 2004
    letter which asked for more information as to why receipts totaling $139624.37
    which were disclosed on our amended pre-general election report were not disclosed
    on the original filing. Due to a computer error the itemized and unitemized receipts
    fields were not captured when compiling the original pre-general report. As soon
    as the error was detected we fixed the error and filed an amended report to include
    the receipts. The Commission also requested a description of our procedures for
    requesting information from contributors. Our procedures are as follows: 1. If
    an individual pledges over $200 during a phone pledge solicitation the solicitors
    shall make a verbal request for donor occupation and employer information. A script
    will be read that informs the donor that such information is required by the FEC.
    This information will be recorded on the donor pledge card. 2.If a contribution
    is received in excess of $200 without obtaining this information a written or
    oral request shall be made to the donor within 30 days after receipt of the contribution
    or after knowledge of the aggregate amount going over $200. A total of two requests
    shall be made for missing information and will be documented. 3.Written request
    will be accompanied by a pre-addressed return envelope and will not include additional
    solicitations. An oral request will comply with the general requirements of the
    written request. 4. Donor information received after the filing of the FEC report
    will be included in an amended report filed with the FEC no later than the due
    date of the next FEC report. This electronically filed amended report reflects
    additional information gathered about donors'' occupation and employer. If the
    Commission has any questions please contact us at 301-299-2343.",'
